staticBinding.value:
$FileContent = @"
${logOut}
"@

$Content=$FileContent -split '\n'

 foreach($Value in $Content) {


    if ($Value -match "^\s*\[log\]:{1}\s*")
    {
        $temp = $Value -replace "\[log\]:", ""
        $log += $temp + "`r`n"


    }

    if ($Value -match "\s*\[status\]\s*:{1}")
    {
        $status = $Value.split(":")[1].trim()
    }

}

if($status -eq 'Failure'){
    $prefix='AHRF'
    $action ='deassign'
}
elseif($status -eq 'Remediation Success'){
    $prefix ='AHRS'
    $action ='deassign'
}
elseif($status -imatch 'PNM'){
    $prefix=$status
    $action ='deassign'
}
else{
    $prefix='ARIP'
    $action='UpdateWorkLogs'
}
return "$prefix"+"|"+"$log"+"!-"+"$action"
